import React, { useState, useEffect } from 'react';
import { Link } from 'react-router-dom';

function ConsultarViajes() {
  const [viajes, setViajes] = useState([]);

  useEffect(() => {
    const fetchViajes = async () => {
      const res = await fetch('http://localhost:3003/consultar-viajes');
      const data = await res.json();
      setViajes(data);
    };
    fetchViajes();
  }, []);

  const handleDelete = async (id) => {
    const res = await fetch(`http://localhost:3003/eliminar-viaje/${id}`, { method: 'DELETE' });
    if (res.ok) {
      setViajes(viajes.filter(viaje => viaje.id !== id));
    }
  };

  return (
    <div>
      <h2>Consultar Viajes</h2>
      <table>
        <thead>
          <tr>
            <th>Pais</th>
            <th>Año</th>
            <th>Mes</th>
            <th>Duración</th>
            <th>Costo</th>
            <th>Km Recorridos</th>
            <th>Acciones</th>
          </tr>
        </thead>
        <tbody>
          {viajes.map(viaje => (
            <tr key={viaje.id}>
              <td>{viaje.pais}</td>
              <td>{viaje.anio}</td>
              <td>{viaje.mes}</td>
              <td>{viaje.duracion}</td>
              <td>{viaje.costo}</td>
              <td>{viaje.kmRecorrido}</td>
              <td>
                <button onClick={() => handleDelete(viaje.id)}>Eliminar</button>
                <Link to={`/modificar-viaje/${viaje.id}`}>Modificar</Link>
              </td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}

export default ConsultarViajes;
